async function writePdf(data) {
    return new Promise((resolve, reject) => {
        let personalInfoCompiledFn = pug.compileFile(
            `./templates/${data.template.toLowerCase()}/personal_info.pug`
        );
        if (data.sections.indexOf('links') !== -1) {
            data.links = data.links.sort((a, b) => a.position - b.position);
        }
        let str = personalInfoCompiledFn({ data: data });
        str.replace('</body>', '');
        str.replace('</html>', '');
        let compiledFunction;
        for (let item of data.sections) {
            switch (item) {
                case 'educations':
                    compiledFunction = pug.compileFile(
                        `./templates/${data.template.toLowerCase()}/educations.pug`
                    );
                    data.educations = data.educations.sort(
                        (a, b) => a.position - b.position
                    );
                    str += compiledFunction({ data: data });
                    break;
                case 'works':
                    compiledFunction = pug.compileFile(
                        `./templates/${data.template.toLowerCase()}/works.pug`
                    );
                    data.works = data.works.sort(
                        (a, b) => a.position - b.position
                    );
                    str += compiledFunction({ data: data });
                    break;
                case 'skills':
                    compiledFunction = pug.compileFile(
                        `./templates/${data.template.toLowerCase()}/skills.pug`
                    );
                    data.skills = data.skills.sort(
                        (a, b) => a.position - b.position
                    );
                    str += compiledFunction({ data: data });
                    break;
                case 'languages':
                    compiledFunction = pug.compileFile(
                        `./templates/${data.template.toLowerCase()}/languages.pug`
                    );
                    data.languages = data.languages.sort(
                        (a, b) => a.position - b.position
                    );
                    str += compiledFunction({ data: data });
                    break;
                case 'honors':
                    compiledFunction = pug.compileFile(
                        `./templates/${data.template.toLowerCase()}/honors.pug`
                    );
                    data.honors = data.honors.sort(
                        (a, b) => a.position - b.position
                    );
                    str += compiledFunction({ data: data });
                    break;
                case 'courses':
                    compiledFunction = pug.compileFile(
                        `./templates/${data.template.toLowerCase()}/courses.pug`
                    );
                    data.courses = data.courses.sort(
                        (a, b) => a.position - b.position
                    );
                    str += compiledFunction({ data: data });
                    break;
                case 'hobbies':
                    compiledFunction = pug.compileFile(
                        `./templates/${data.template.toLowerCase()}/hobbies.pug`
                    );
                    str += compiledFunction({ data: data });
                    break;
                case 'references':
                    compiledFunction = pug.compileFile(
                        `./templates/${data.template.toLowerCase()}/references.pug`
                    );
                    data.references = data.references.sort(
                        (a, b) => a.position - b.position
                    );
                    str += compiledFunction({ data: data });
                    break;
                case 'projects':
                    compiledFunction = pug.compileFile(
                        `./templates/${data.template.toLowerCase()}/projects.pug`
                    );
                    data.projects = data.projects.sort(
                        (a, b) => a.position - b.position
                    );
                    str += compiledFunction({ data: data });
                    break;
                default:
                    break;
            }
        }
        str += '</div></body></html>';
        (async () => {
            let result = null;
            let browser = null;

            try {
                browser = await chromium.puppeteer.launch({
                    args: chromium.args,
                    defaultViewport: chromium.defaultViewport,
                    executablePath: await chromium.executablePath,
                    headless: true,
                });

                let page = await browser.newPage();

                await page.setContent(str);

                await page.pdf({
                    path: `./test.pdf`,
                    format: 'A4',
                    printBackground: true,
                    margin: { top: '1.5cm', bottom: '1.5cm' },
                });
            } catch (error) {
                console.log(await chromium.executablePath);
                reject(error);
            } finally {
                if (browser !== null) {
                    await browser.close();
                    resolve({});
                }
            }
        })();
    });
}

